package newprogram;

public class multiDimArr {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a[][]= {{1,2,3}, {3,5,6}, {5,7,9}};
		for(int i =0;i<3;i++) {
			for (int j=0;j<3;j++) {
				System.out.print(a[i][j]+" ");
			}
			System.out.println();
		}
		}
		
}


